import React from 'react';
import { NavLink } from 'react-router-dom';

const Footer = () => {
    return (
        <div className="flex flex-wrap">
            <div className="col-md-4 col-6 mr-5">
                <h3 className="text-2xl">Our Framework Courses</h3>
                <p className="text-gray-500"><NavLink to="services/node">NodeJS</NavLink></p>
                <p className="text-gray-500"><NavLink to="services/express">Express</NavLink></p>
                <p className="text-gray-500"><NavLink to="services/laravel">Laravel</NavLink></p>
                <p className="text-gray-500"><NavLink to="services/laravel">Spring Boot</NavLink></p>
            </div>
            <div className="col-md-4 col-6">
                <h3 className="text-2xl">Our Framework Courses</h3>
                <p className="text-gray-500"><NavLink to="services/node">NodeJS</NavLink></p>
                <p className="text-gray-500"><NavLink to="services/express">Express</NavLink></p>
                <p className="text-gray-500"><NavLink to="services/laravel">Laravel</NavLink></p>
                <p className="text-gray-500"><NavLink to="services/laravel">Spring Boot</NavLink></p>
            </div>
        </div>
    );
};

export default Footer;
